$(document).ready(function () {

    google.charts.load("current", { packages: ["corechart"] });
    google.charts.setOnLoadCallback(drawChart);
    function drawChart() {
        var data = google.visualization.arrayToDataTable([
            ['Task', 'Hours per Day'],
            ['Work', 11],
            ['Eat', 2],
            ['Commute', 2],
            ['Watch TV', 2],
            ['Sleep', 7]
        ]);

        var options = {
            title: 'My Daily Activities',
            pieHole: 0.4,
        };

        var chart = new google.visualization.PieChart(document.getElementById('donutchart'));
        chart.draw(data, options);
    }

});

const HashtagContainer = () => {
    return (
        <>
            <div className="hc-container">
                <div className="hc-head">
                    <h4 className="hc1 hc1-s1">#BlackLivesMatter</h4>
                    <div className="form-group hc1 hc1-s2">
                        <button type="submit" className="btn btn-primary hcbtng">Generate</button>
                    </div>
                </div>
                {/* ----------------Body of Hashdetail */}
                <div className="container d-flex justify-container-center">
                    <div className="row">
                        <div className="col-md-12">
                            <div id="donutchart" style="width: 900px; height: 500px;"></div>
                        </div>
                    </div>
                </div>

                <div>

                </div>

            </div>
        </>
    );
}


export default HashtagContainer;
